import './App.css';
import { sampleData } from './backend';
import { CsvToHtmlTable } from 'react-csv-to-table';
import "bootstrap/dist/css/bootstrap.css"

function App() {

  const handelOnFileLoad = (sampleData) => {
    console.log(sampleData)
  }
  return (
    <>
      <div className='container' Style="margin:30px">
        <input type="text" placeHolder="Search" className="search" />
        <ul className='list'>
          <li className='listItem'>Ani</li>
          <li className='listItem'>Anitha</li>
          <li className='listItem'>Ani i love you</li>
        </ul>
      </div>
      <div className="App" style={{ display: "flex", justifyContent: "center" }}>
        <Notes />
      </div>
    </>
  );
}
function Notes() {
  return (
    <div >
      <CsvToHtmlTable
        data={sampleData}
        csvDelimiter=","
        tableClassName="table table-striped table-dark "
      />
    </div>
  )
}
function Input() {
  return (
    <select>
      <option value="grapefruit">Grapefruit</option>
      <option value="lime">Lime</option>
      <option selected value="coconut">Coconut</option>
      <option value="mango">Mango</option>
    </select>
  )
}
export default App;
